// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.2 <0.9.0;
import "@openzeppelin/contracts/utils/Counters.sol";
contract Company {
    
    enum BusStatus { Waiting, Approved, Rejected, Noted, ForwardToCoordinator , ForwardToHTMC }

    uint256 private  AVALIABLE_YEARS = 10;
    address public coordinatorContractAddress; 

    using Counters for Counters.Counter;
    Counters.Counter private busId;
    
    struct BusItem {
        uint256 id;
        uint256 model;
        string vim_number;
        uint256 company_number;
        string plate_number;
        uint256 expire_date;
        BusStatus status;
        address owner;
        address creator;
    }
    
   event BusCreateted 
   (  
   uint256 id,
   uint256 model,
   string vim_number,
   uint256 company_number,
   string plate_number,
   uint256 expire_date,  
   BusStatus status,
   address owner,
   address creatore
    );

    mapping(uint256 => BusItem) public buses;

    constructor() {}

    function addBus(uint256 _model,string  memory _vim_number,uint256 _company_number,string memory _plate_number)public  {
        //buses[id] = bus;
        require(_model>2013,"Car Model shoudl be larger than 2013");
        require(bytes(_vim_number).length>1,"Car _vim_number shoudl be larger than 24 chars");
        require(_company_number>0,"_company_number shoudl be larger than Zero");
        //require(nftContract !=address(0),"Address should not be equal 0x0 or nulled");

        //TO DO =>2015 =>2026 NOT WORK 
        uint256 expireYear = _model + AVALIABLE_YEARS ;
        busId.increment();
        uint256 id = busId.current();
      
        BusStatus status = BusStatus.Waiting;
        buses[id] = BusItem(id,_model,_vim_number,_company_number,_plate_number,expireYear,status,address(this),msg.sender);
        //IERC721(nftContract).transferFrom(msg.sender,address(this),tokenId);
        emit BusCreateted(id,_model,_vim_number,_company_number,_plate_number,expireYear,status,address(this),msg.sender);

    }

    function getSingleBus(uint256 id) public  view returns  (BusItem memory)
    {
        require(id <= busId.current(),"Id Not Found");
        return buses[id];
    }

    function updateBusStatus(uint256 id, BusStatus newStatus) public {
        require(buses[id].id != 0, "Bus does not exist");
        buses[id].status = newStatus;
    }

    function forwardBusToCoordinator(uint256 busToForewardId) public {
        require(buses[busToForewardId].id != 0, "Bus does not exist");
        require(buses[busToForewardId].status == BusStatus.Waiting, "Bus is not in a valid state to be forwarded");
        require(msg.sender == buses[busToForewardId].creator, "Only the bus creator can forward the bus");

        // Update the status to indicate it's been forwarded to the Coordinator
        buses[busToForewardId].status = BusStatus.ForwardToCoordinator;
        buses[busToForewardId].owner = coordinatorContractAddress;

    }

     // Function to set the Coordinator contract address
    function setCoordinatorAddress(address _newCoordinatorContractAddress) public {
        // Only allow the contract owner or another authorized entity to set the Coordinator address
        //require(msg.sender == owner, "Unauthorized"); // Replace 'owner' with actual owner check
        coordinatorContractAddress = _newCoordinatorContractAddress;
    }

    function getAllSentToCoordinator() public view returns (BusItem[] memory) {
        uint256 totalBuses = busId.current();
        uint256 count = 0;

        // First, count how many buses have been sent to the Coordinator
        for (uint256 i = 1; i <= totalBuses; i++) {
            if (buses[i].status == BusStatus.ForwardToCoordinator) {
                count++;
            }
        }

        // Create an array to store the buses
        BusItem[] memory sentBuses = new BusItem[](count);
        uint256 j = 0;

        // Populate the array
        for (uint256 i = 1; i <= totalBuses; i++) {
            if (buses[i].status == BusStatus.ForwardToCoordinator) {
                sentBuses[j] = buses[i];
                j++;
            }
        }
        return sentBuses;
    }

}

